import React from "react";
import { View, Text, StyleSheet, Select, Pressable , TextInput, ScrollView, Image} from "react-native";
import Constants from 'expo-constants'
import { CartAlt, BellNotification, Search, FastArrowRight, Heart } from "iconoir-react-native";
import StyledImput from "../../src/styles/StyledImput";
import theme from "../../src/theme/theme";
import string from "../../src/string/string";
import StyledText from "../../src/styles/StyledText";


const HomeClient = () =>{

    return(

        <View style={styles.container}>
            <View style={styles.header}>

                <Pressable>
                    <BellNotification width={30} height={30} color={"black"} style={styles.icon}/>
                </Pressable>

                <Pressable>
                    <CartAlt width={30} height={30} color={"black"} style={styles.icon}/>
                </Pressable>

            </View>

            <View style={styles.subHeader}>
                <View style={styles.search}>
                    <Search width={28} height={28} color={"gray"} style={styles.icon}/><TextInput placeholder={string.client.search}></TextInput>
                </View>
            </View>

            <View style={styles.store}>
                <StyledText title bold >{string.client.near}</StyledText>
                <FastArrowRight width={28} height={28} color={"black"} style={styles.icon}/>
            </View>
            <ScrollView horizontal>

                <View style={{backgroundColor:theme.colors.greenOpacity,borderRadius:10}}>

                    <Image source={require("../../assets/XCampo.png")} style={{width:180, height:100, borderTopLeftRadius: 10, borderTopRightRadius: 10}}></Image>

                    <View style={{flexDirection:"row", justifyContent:"space-between", with: 1}}> 
                        <StyledText bold>name finca</StyledText>
                        <Heart width={30} height={30} color={"black"}/>
                    </View>

                    <StyledText>location</StyledText>

                </View>

            </ScrollView>

        </View>

    )

}

const styles = StyleSheet.create({
    container:{
        marginTop: Constants.statusBarHeight
    },
    header:{
        flexDirection: "row",
        backgroundColor: theme.colors.greenOpacity,
        paddingTop: 5,
        paddingBottom: 20,
    },
    subHeader:{
        flexDirection: "row",
        backgroundColor: theme.colors.greenOpacity,
        borderBottomStartRadius: 10,
        borderBottomEndRadius: 10,

    }
    ,
    scroll:{

    }, 
    icon:{
        marginStart:10
    },
    search:{
        flexDirection: "row",
        backgroundColor: theme.colors.grey,
        borderRadius: 15,
        marginStart: 10,
        width: 200,
        marginBottom: 10,
        alignItems: "center"
    },
    store:{
        flexDirection: "row",
        paddingTop: 5,
        paddingBottom: 20,
        with: 1,
        justifyContent: "space-between"
    },
})

export default HomeClient;
